import React, {useState, useEffect} from 'react';
import './Treasurepage.css';
import arrow_left from '../images/arrow_icon_left_black.svg';
import arrow_right from '../images/arrow_icon_right_black.svg';
import treeicon2 from '../icons/treasureicons/treeicon2.svg';
import bookmark_darkgreen1 from '../icons/treasureicons/bookmark_darkgreen1.svg';
import treasureData from './TreasureData';
import exploreicon from '../icons/explore_icon_25x25.svg';


function Treasurepage() {
  const [index, setIndex] = useState(0);
  const [treasure, setTreasure] = useState([]);

  const slideRight = () => {
    setIndex((index + 1) % treasure.length);
  }

  const slideLeft = () => {
    if (index - 1 < 0) {
      setIndex(0)
    } else {
      setIndex(index - 1);
    }
  }

  useEffect(() => {
    setTreasure(treasureData);
  }, []); // dependency array: empty array -> run once

  function clickMe(category) {
    setTreasure(treasureData.filter((treasure) => treasure.treasure === category));
  }


console.log(index)
  return (
    <div className="App">

      <div className="content__card--wrapper">

          <div className="allbuttons__container">

                  <button onClick={slideLeft} className="buttonbox__left">
                    <img src={arrow_left} alt="arrow_left" className="button__icon--left"/>
                  </button>

                  <button onClick={slideRight} className="buttonbox__right">
                    <img src={arrow_right} alt="arrow_right" className="button__icon--right"/>
                  </button>

          </div>

          {/* ///////////////////////////////////////////// */}

          { treasure[index] && (
            <div className="treasure__container">
              <img className="main__image" src={treasure[index].img} alt="image_1"/>

              <div className="title__wrapper">
                <h3 className="treasure__title">{treasure[index].name}</h3>
              </div>

              <div className="subline__wrapper">

                {/*<div className="icon__wrapper">
                <button className="button__icon" width="20" height="20">
                  <img src={treeicon2} alt="icon" width="30" height="35"/>
                </button>
                </div>

                <div className="icon__wrapper">
                <button className="button__icon" width="20" height="20">
                  <img src={exploreicon} alt="icon" width="30" height="35"/>
                </button>
          </div>*/}

                <div className="icon__wrapper">
                <button className="button__icon" width="5" height="5">
                  <img src={bookmark_darkgreen1} alt="icon" width="20" height="20"/>
                </button>
                </div>

                {/*<p className="forest__text">{forest[index].text}</p>*/}

              </div>



              <div className="paragraph__wrapper">
                <h5 className="paragraph__info--headline5">{treasure[index].info}</h5>
                <ul className="paragraph__listitems">
                <li className="paragraph__listitem--hut"><strong>Hut:&nbsp;</strong> {treasure[index].Hut}</li>
                <li className="paragraph__listitem--hutfarbe"><strong>Hutfarbe:</strong> {treasure[index].Hutfarbe}</li>
                <li className="paragraph__listitem--stiel"><strong>Stiel:</strong>{treasure[index].Stiel}</li>
                <li className="paragraph__listitem--wuchshöhe"><strong>Wuchshöhe:</strong>{treasure[index].Wuchshöhe}</li>
                <li className="paragraph__listitem--fleisch"><strong>Fleisch:</strong>{treasure[index].Fleisch}</li>
                <li className="paragraph__listitem--fruchtkörper"><strong>Fruchtkörper:</strong>{treasure[index].Fruchtkörper}</li>
                <li className="paragraph__listitem--besonderheit"><strong>Besonderheit:</strong>{treasure[index].Besonderheit}</li>
                <li className="paragraph__listitem--verweckslungsgefahr"><strong>Verwechslung:</strong>{treasure[index].Verwechslungsgefahr}</li>


                </ul>
              </div>
              {/*<h2>Index: {index}</h2>*/}


            </div>
          )}



          {/*
          <div className="forest__card--output">
          {forest.map((forest) => (

                  <div className="image">
                      <img src={image_1} width="500" height="500" alt="image_1" />
                  </div>

                  <h1 key={treasure.id}>{forest.name}</h1>

                  <div className="text">
                  <p key={treasure.id}>{treasure.text}</p>
                  </div>

                  )

        </div>
          */}



      </div>
    </div>
  );
}

export default Treasurepage;
